ORAÇÃO AO SENHOR
Meu Deus, livrai-nos do homem: 
> que fala de paz e amor, mas espalha o ódio e a discórdia;
> que fala da Família, mas espalha a desunião; 
> que abomina a violência, mas espalha as armas; 
> que fala de democracia, mas não aceita as regras;
> que fala da liberdade, mas manda calar todos os que discordam; 
> que diz amar a Pátria, mas isola-a do mundo; 
Glória a Deus nas alturas, que a paz do Senhor esteja convosco, livrai-nos do mal, AMÉM!
